import './App.css';

import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        My storybook test
      </header>
      <main>
        <div className="card">
          <h2>Hello world</h2>
          <img src="./bayern.jpg" className="App-logo" alt="logo" />
          <p>Testitest</p>
        </div>
      </main>
    </div>
  );
}

export default App;
